Steps for adding Passport Github OAuth - TL;DR version

1. Database migration for users
 - create database (*createdb foo*), link it to the program
 - configure the database file in server &gt; db &gt; migrations for up and down
 ```exports.up = (knex, Promise) =&gt; {
   return knex.schema.createTable('users'), (table) =&gt; {
     table.increments();
   }
 };
 ```

2. Register an account on Github (or whatever site you're trying to get an auth from...)
 - On GitHub: Personal settings &gt; OAuth settings
 - You'll get a Client ID and Client Secret

3. Copy the keys over to the *.env* file
 - You know how to copy and paste, right?
 - Make sure .env is in your gitignore
 - If you have an app that requires these keys, consider creating a dummy *.env* file with sample (fake) keys that another user can replace and rename to make the app work.
 - use SCREAMING_SNAKE_CASE for the key to remind yourself that it's a constant so don't fuck with it.

4. Set up the main passport config
 - *npm install passport --save*
 - mount passport to app middleware
 - *main-config.js*
 - add *const passport = require('passport');* as a main dependency
 - Make sure you mount *app.use(passport());* AFTER *express-session* in the middleware
 - in Python: *import os* + *os.urandom(24)* &lt; this generates a random key 24 characters long. You can use another program, but it has to be random. Don't call it *keyboard_cat*.
 - set this random key as SECRET_KEY in the .env file

 5. init passport along with session management
 - create new folder in *server* called *auth*, and create a file called *init.js*. Put this inside of it, even though Mike doesn't know how it works:
 ```
 const passport = require('passport');
 const knex = require('../db/knex');
 module.exports = () =&gt; {
   passport.serializeUser((user, done) =&gt; {
     done(null, user.id);
   });
   passport.deserializeUser((id, done) =&gt; {
     return knex('users')
     .select('*')
     .where({
       id: id
     })
     .then((user) =&gt; {
       done(null, user[0]);
     })
     .catch((err) =&gt; {
       done(err);
     });
   });
 };
 ```

6. Init specific auth strategy for the specific auth provider
 - in *server &gt; auth*, add a new .js file for github (or whatever new auth you're trying to add). Copy this huge code block into it:
 ```
 const passport = require('passport');
 const GitHubStrategy = require('passport-github2').Strategy;
 const init = require('./init');
 passport.use(new GitHubStrategy({
   clientID: process.env.GITHUB_CLIENT_ID,
   clientSecret: process.env.GITHUB_SECRET_KEY,
   callbackURL: process.env.GITHUB_CALLBACK_URL
   },
   (accessToken, refreshToken, profile, done) =&gt; {
     console.log(arguments);
   }
 ));
 // serialize user into the session
 init();
 module.exports = passport;
 ```
 If you aren't using github, google a similar syntax for whatever site you're trying to auth into, or learn how to create this file your damn self.
 Make sure to rename the values in lines 14-16 to your secret keys (don't enter the keys, dummy; use *process.env.WHATEVER_YOU_CALLED_THEM*)

7. Set up some helper functions
 - login
 - logout
 - authRequired
 - loginRedirect
 - adminRequired (optional)

