function rotateMatrix(matrix) {
  let newArray = [];
  let result = [];
  for (let i = 0; i &lt; matrix[0].length; i++) {
    newArray = [];
    for (let j = 0; j &lt; matrix.length; j++) {
      if (matrix[j]) {
        newArray.unshift(matrix[j][i]);
      }
    }
    result.push(newArray);
  }
  return result;
}
